import ContactForm from './ContactForm';
import './CompoApp.css';

function App() {
  return (
    <div>
      <div className="App">
        <h1>Apply for a Job</h1>
      </div>
      <div>
        <ContactForm/>
      </div>
    </div>
  );
}

export default App;
